import React from 'react';

export default class User extends React.Component 
{
    render(){
        return(
            <div>
                <p>Voici les membres du groupe : </p>
                <p> Hugo </p>
                <p> Florent</p>
                <p> Erwan </p>
                <p> Gwenael </p>
            </div>
        );
    }
}
